values_y.push(y);\n    }\n    var b_str = roundToTwo(b).toString();\n    var m_str = roundToTwo(m).toString();\n    var r2 = roundToTwo(Math.pow((n*sum_xy - sum_x*sum_y)/Math.sqrt((n*sum_xx-sum_x*sum_x)*(n*sum_yy-sum_y*sum_y)),2)).toString();\n    legend_obj.label.value = \"y=\"+b_str+\"+x*\"+m_str +\";  r2=\"+r2;\n    //console.log('eq:', x, roundToTwo(m), roundToTwo(b));\n    data['x'] = result_values_x;\n    data['y'] = result_values_y;\n    source.change.emit();\n    "},"id":"1103","type":"CustomJS"},{"attributes":{"overlay":{"id":"1040"}},"id":"1036","type":"LassoSelectTool"},{"attributes":{},"id":"1224","type":"AllLabels"},{"attributes":{"axis":{"id":"1119"},"dimension":1,"ticker":null},"id":"1122","type":"Grid"},{"attributes":{"items":[{"id":"1101"}],"location":"top_left"},"id":"1102","type":"Legend"},{"attributes":{},"id":"1120","type":"BasicTicker"},{"attributes":{},"id":"1226","type":"BasicTickFormatter"},{"attributes":{"callback":null,"tooltips":[["Serie","@key"],["Value","@x"]]},"id":"1129","type":"HoverTool"},{"attributes":{},"id":"1235","type":"UnionRenderers"},{"attributes":{},"id":"1127","type":"SaveTool"},{"attributes":{},"id":"1227","type":"AllLabels"},{"attributes":{"source":{"id":"1088"}},"id":"1179","type":"CDSView"},{"attributes":{},"id":"1124","type":"WheelZoomTool"},{"attributes":{},"id":"1236","type":"Selection"},{"attributes":{"label":{"value":"stats"},"renderers":[{"id":"1099"}]},"id":"1101","type":"LegendItem"},{"attributes":{},"id":"1123","type":"PanTool"},{"attributes":{"js_property_callbacks":{"change:value":[{"id":"1182"}]},"options":["TEMP_BTL","TEMP_CTD","SALT_BTL","SALT_CTD","DOXY_BTL","DOXY_CTD","H2S","PH","PH_LAB","ALKY","FLUO_CTD","CPHL"],"title":"X-parameter","value":"FLUO_CTD"},"id":"1180","type":"Select"},{"attributes":{"overlay":{"id":"1128"}},"id":"1125","type":"BoxSelectTool"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_colo
